import React from "react";
import logo from "./logo2.svg";

function Navbar() {
  return (
    <div>
      <nav class="navbar navbar-light bg-dark">
        <div class="container-fluid">
          <a class="navbar-brand">
            {" "}
            <img src={logo}></img>
          </a>
          <div class="d-flex">reduce</div>
        </div>
      </nav>
    </div>
  );
}

export default Navbar;
